    // console.log(data);
    return (
        <div>
            <table border={1}>
                <thead>
                    <tr>
                        {data.colums.map((col) => {
                            return <th key={col.cell}>{col.header}</th>
                        })}
                    </tr>
                </thead>
                <tbody>

                    {data.rows.map((row, i)=>{
                        return <tr key={i}></tr>
                    })}
